import React from 'react';
import csLogo from '../../IMAGES/cslogo.jpg'; // Ajusta la ruta según la estructura de tu proyecto

const Header = () => {
  return (
    <header>
      <img src={csLogo} alt="Logo" />
      <h1>Pibardo Skins</h1>
    </header>
  );
};

export default Header;
